import './Navigation.css'

function Navigation() {

  return (
    <div className='navigation__movies'>
      <button className='navigation__movies-button navigation__movies-button_search' type="button">Фильмы</button>
      <button className='navigation__movies-button navigation__movies-button_saved' type="button">Сохранённые фильмы</button>
      <button className='navigation-button__account' type="button">Аккаунт</button>
    </div>
  )
}

export default Navigation;
